Jacob Marley	The Counting-House
My spirit never walked beyond our counting-house... in life my spirit never roved beyond the narrow limits of our money-changing hole;
Marley's spirit says he never roved beyond the counting-house in life, symbolizing the narrowness of his worldly focus.

